export default function Question() {
    const {topic} = useParams();
    const topicData = learningContent.find(t => t.topic === decodeURIComponent(topic));
    return (
        <div className="question-container">
            <div className="question-navbar">
                <SmallTitle />
            </div>
        </div>
    )
}
